import updateCardCSS from './styles/updateCard.module.css'

function UpdateCard({authorName, bookTitle}){
	return (
		<div className={updateCardCSS.container}>
			<h2>{authorName}</h2>
			<p>{bookTitle}</p>
		</div>
	);}

export default UpdateCard;
